import React from 'react';

export function ImageComponent({ productImage }) {  
     

  const imageUrl = `data:image/jpeg;base64,${Buffer.from(productImage).toString('base64')}`;

  return (
    <div>
      <img src={imageUrl} alt="Product" />
    </div>
  );
}
